(1, 'Quy Định Về Nạp Sai Mệnh Giá', '<p class=\"mb-0\" style=\"margin: 10px 0px; padding: 0px; outline: 0px; line-height: 1.8; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: 700;\">Quý khách gửi thẻ sẽ có 2 mệnh giá : 1 là mệnh giá quý khách gửi lên , 2 là mệnh giá thực của thẻ</span></p><p class=\"mb-0\" style=\"margin: 10px 0px; padding: 0px; outline: 0px; line-height: 1.8; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: 700;\">Khi nạp sai mệnh giá bạn sẽ nhận được 50% mệnh giá nhỏ ( mệnh giá nhỏ chứ ko phải mệnh giá thực )</span></p><p class=\"mb-0\" style=\"margin: 10px 0px; padding: 0px; outline: 0px; line-height: 1.8; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: 700;\">Ví dụ :</span></p><p class=\"mb-0\" style=\"margin: 10px 0px; padding: 0px; outline: 0px; line-height: 1.8; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; font-weight: 700;\">Quý khách gửi thẻ mệnh giá&nbsp;<span class=\"text-danger\" style=\"color: rgb(169, 68, 66); padding: 0px; margin: 0px; outline: 0px;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; color: rgb(224, 62, 45);\">100.000đ&nbsp;</span></span>&nbsp;mà mệnh giá thực là&nbsp;<span style=\"padding: 0px; margin: 0px; outline: 0px; color: rgb(35, 111, 161);\">1</span><span class=\"text-info\" style=\"color: rgb(49, 112, 143); padding: 0px; margin: 0px; outline: 0px;\"><span style=\"padding: 0px; margin: 0px; outline: 0px; color: rgb(35, 111, 161);\">0.000đ</span></span>&nbsp;thì quý khách sẽ nhận được số