(55, 'dieu_khoan', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">I. QUY ĐỊNH CHUNG</span><br></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;1. Sử dụng hợp pháp</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"color: rgb(51, 51, 51); font-weight: 700;\">&nbsp;&nbsp;</span><font color=\"#333333\">Khách hàng chỉ được phép sử dụng&nbsp;</font><span style=\"caret-color: rgb(51, 51, 51);\"><span style=\"font-weight: bolder;\"><font color=\"#ff0000\">ANORI.VN</font></span><font color=\"#333333\">&nbsp;</font></span><font color=\"#333333\">cho các sản phẩm và dịch vụ được cung cấp. Khách hàng không được phép thực hiện các hành vi gian lận, giả mạo, gian lận … các hành động cố tình gây phá hoại, thiệt hại cho hệ thống&nbsp;</font><span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><font color=\"#333333\">. Bất cứ xâm phạm trái phép của khách hàng vào hệ thống&nbsp;</font><span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"color: rgb(51, 51, 51); caret-color: rgb(51, 51, 51);\">&nbsp;</span><font color=\"#333333\">sẽ bị cảnh báo, khoá tài khoản.</font></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp;<span style=\"font-weight: 700;\">2. Bồi thường và thiệt hại</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;&nbsp;</span>Khách hàng có nghĩa vụ bồi thường cho&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>hoặc bên thứ ba nào cho toàn bộ/ bất cứ thiệt hại thực tế nào mà phần lỗi được xác định do khách hàng khi xảy ra một trong các tình huống sau đây:</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; &nbsp;- Vi phạm các điều khoản Thoả thuận này hoặc các Thor thuận dịch vụ khác giữa&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>và khách hàng.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; &nbsp;- Vi phạm các quy định và pháp luật hiện hành gây ảnh hưởng/ thiệt hại đến&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span>.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; &nbsp;- Xâm phạm quyền sở hữu trí tuệ hoặc quyền lợi hợp pháp của bất kì cá nhân/ tổ chức nào gây ảnh hưởng thiệt hại đến&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span>.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; &nbsp;- Sự vô ý hoặc hành vi cố ý làm sai của khách hàng, nhân viên và đại lý của khách hàng gây ảnh hưởng/ thiệt hại đến&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span>.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">II. QUY ĐỊNH SỬ DỤNG DỊCH VỤ</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;1. Đăng ký sử dụng dịch vụ</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;&nbsp;</span>- Tên đăng nhập là số thuê bao điện thoại khách hàng</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Chủ tài khoản cần cung cấp thông tin chính xác,&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">TUANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>sẽ căn cứ vào thông tin của khách hàng để hỗ trợ các tranh chấp liên quan đến sử dụng tài khoản. Việc cung cấp thông tin chính xác giúp&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">TUANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>bảo vệ quyền lợi chính đáng của chủ tài khoản.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Chủ tài khoản phải tự bảo quản tài khoản, mật khẩu, email, ... đề phòng sự cố xảy ra (ví dụ: bị hack, nhớ sai mật khẩu, ... )</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp;<span style=\"font-weight: 700;\">2. Nạp tiền</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;&nbsp;</span>- Phạm vi:</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; Khách hàng Nạp tiền vào tài khoản bằng cách đăng nhập vào tài khoản, chọn mục Nạp tiền tại Tab Tài khoản để thực hiện giao dịch nạp tiền.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Trường hợp hạn chế:</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; Khách hàng không được nạp tiền vào tài khoản trong trường hợp tiền có nguồn gốc không rõ ràng và bất hợp pháp, ví dụ: lừa đảo, rửa tiền, ...</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp;<span style=\"font-weight: 700;\">3. Mua hàng hóa, dịch vụ</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;&nbsp;</span>- Phạm vi:</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; Khách hàng đăng nhập vào tài khoản, chọn Tab để mua các sản phẩm và dịch vụ được cung cấp hợp pháp bởi&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span>.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Thời gian xử lí:</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; Hàng hóa, dịch vụ mà khách hàng mua và thanh toán thành công sẽ được xuất trả ngay cho khách hàng trên hệ thống.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Trường hợp hạn chế:</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; Thao tác mua hàng bị hạn chế trong trường hợp trong kho hết hàng hoặc tài khoản của khách hàng không đủ số dư thực hiện giao dịch.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">III. QUY ĐỊNH ĐỐI VỚI KHÁCH HÀNG</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;1. &nbsp;Trách nhiệm của khách hàng</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;&nbsp;</span>- Được quyền sử dụng mọi sản phẩm, dịch vụ được cung cấp hợp pháp trên website A<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">NORI.VN</span><span style=\"font-weight: 700;\">.</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Được quyền sử dụng các sản phẩm, dịch vụ có trả phí của A<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">NORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>nếu như số dư số dư trong tài khoản của quý khách hàng đủ điều kiện để chi trả sử dụng dịch vụ đó.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Khách hàng đồng ý sử dụng dịch vụ trực tuyến&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>có nghĩa là khách hàng đồng ý với các quy định về quyền lợi và nghĩa vụ mà&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>đưa ra.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Thông báo hoặc khiếu nại với&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>khi khách hàng phát hiện các giao dịch của mình bị lỗi, giao dịch không hợp lệ, giao dịch không chính xác. Để thông báo hoặc khiếu nại về chất lượng sản phẩm, dịch vụ của&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span>, khách hàng nhắn tin zalo hoặc nhắn tin trực tiếp Page.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Quyền từ chối sử dụng các sản phẩm/dịch vụ trực tuyến của&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>theo các yêu cầu chính đáng của khách hàng không được đáp ứng.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp;<span style=\"font-weight: 700;\">2. Trách nhiệm và nghĩa vụ của khách hàng</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Khi sử dụng&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span>, khách hàng sẽ luôn phải chịu trách nhiệm với mọi giao dịch xuất phát từ tài khoản của mình.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Khách hàng không được phép thực hiện các hành vi lừa đảo, gian lận, giả mạo, … hay các hành động cố tình phá hoại, gây thiệt hại cho hệ thống&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span>.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; - Khi khách hàng đã đồng ý với bản thỏa thuận sử dụng dịch vụ này, khách hàng có nghĩa vụ phải tuân thủ mọi điều khoản và quy định thỏa thuận sử dụng dịch vụ. Chính sách bảo mật thỏa thuận sử dụng tương ứng khi sử dụng dịch vụ. Nếu xác định được khách hàng có hành vi vi phạm những điều khoản và những điều kiện này.&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">TUANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>có thể đơn phương tạm khoá hoặc khoá vĩnh viễn tài khoản: (1) sử dụng dịch vụ của Khách hàng; (2) tài khoản sử dụng; (3) truy cập trang này.&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>có quyền thông báo các hoạt động bị nghi ngờ vi phạm này cho cơ quan chức trách hoặc bên thứ ba nếu xét thấy còn thiết.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">IV. QUY ĐỊNH VỀ HÀNG HOÁ, DỊCH VỤ</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;1. Hàng hoá</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\"><span style=\"font-weight: 700;\">&nbsp;&nbsp;</span>Hàng hoá cung cấp trên&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>được thể hiện dưới dạng Mã thẻ, Mệnh giá nạp tiền, …</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp; Mã thẻ hay Mã thẻ trả trước: là mã số do&nbsp;<span style=\"caret-color: rgb(51, 51, 51);\">Trumdoicard247&nbsp;</span>cung cấp, được truyền tải và lưu trữ dưới dạng cơ sở dữ liệu được mã hoá trên phần mềm của các thiết bị tin học, dùng cho khách hàng của&nbsp;<span style=\"color: rgb(255, 0, 0); font-weight: 700; caret-color: rgb(51, 51, 51);\">ANORI.VN</span><span style=\"caret-color: rgb(51, 51, 51);\">&nbsp;</span>để nạp tiền cho dịch vụ: Viễn thông, Game, Điện thoại Quốc tế và các dịch vụ số khác … Mỗi mã thẻ sẽ bao gồm (01) số series và một (01) mã Code, các mã thẻ đó tương ứng với quy định của đơn vị cung cấp dịch vụ và không trùng với bất kỳ số series và mã Code trong toàn bộ cơ sở dữ liệu của Nhà cung cấp dịch vụ khác.</p>'),
