(59, 'luuy_ref', '<ul>\r\n    <li>Các tài khoản được hệ thống xác định là tài khoản trùng lặp với các tài khoản khác sẽ không được sử dụng để tính hoa hồng.</li><li>Khi phát hiện bạn cố tình nhân bản tài khoản để giảm chiết khấu thẻ, chúng tôi sẽ từ chối thanh toán hoa hồng và <font color=\"#ff0000\"><span style=\"font-weight: 700;\">BAN</span></font> trực tiếp.</li><li>Hoa hồng chỉ được tính khi bạn bè của bạn đổi thẻ thành công.</li><li>Việc xác định ai là người giới thiệu của người dùng hoàn toàn phụ thuộc vào liên kết giới thiệu. Nếu một người dùng nhấp vào nhiều link rel khác nhau thì chỉ có link ref cuối cùng họ nhấp vào trước khi tạo tài khoản là có hiệu lực.</li><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; text-align: center;\">——————————————————</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; caret-color: rgb(51, 51, 51); text-size-adjust: 100%;\">Copy link CTV đăng lên các trang mạng xã hội.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; caret-color: rgb(51, 51, 51); text-size-adjust: 100%;\">- Bạn<span style=\"font-weight: 700;\"> (A)</span> giới thiệu bạn <span style=\"font-weight: 700;\">(B)</span>, bạn<span style=\"font-weight: 700;\"> (C)</span>, bạn <span style=\"font-weight: 700;\">(D)</span></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; color: rgb(51, 51, 51); font-family: Roboto, Arial, Helvetica, sans-serif; font-size: 14px; caret-color: rgb(51, 51, 51); text-size-adjust: 100%;\">- Bạn <span style=\"font-weight: 700;\">(B)</span>, bạn <span style=\"font-weight: 700;\">(C)</span>, bạn <span style=\"font-weight: 700;\">(D)</span> đổi thẻ cào trị giá 100.000đ (Tổng 300k). Bạn<span 